import { useState } from "react";
import React from "react";

function Information (props){


    return (
        <div className= "PageContent">
          <p>{props.title}</p>
          <p>{props.position}</p>
          <p>{props.description}</p>
          <p>{props.platform1}</p>
          <p>{props.platform2}</p>
          <p>{props.platform3}</p>
          <p>{props.platform4}</p>
        </div>
      );
}

export default Information;
